import "./FilterBar.css"
import {useEffect, useState} from "react";
import {starterData} from "../data/starterData";
import {MdOutlineFilterList} from "react-icons/md";

const FilterBar = ({pokemonData, setPokemonData}) => {

    const [filterString, setFilterString] = useState("");
    const [selectedValue, setSelectedValue] = useState("n/a");
    const [selectedType, setSelectedType] = useState("n/a");

    const handleFilterChange = event => {
        setFilterString(event.target.value);
        setPokemonData(pokemonData.filter(pokemon => pokemon.name.includes(filterString.toLowerCase())));
    }

    const handleResetFilter = () => {
        setPokemonData(starterData);
        setFilterString("");
        setSelectedValue("n/a");
        setSelectedType("n/a");
    }

    const handleSelectValueChanged = event => {
        setSelectedValue(event.target.value);
        if (event.target.value === "n/a") {
            setPokemonData(starterData);
        }
        if (event.target.value === "I") {
            setPokemonData(pokemonData.filter(pokemon => (pokemon.id >= 1 && pokemon.id <= 151)));
        }
        if (event.target.value === "II") {
            setPokemonData(pokemonData.filter(pokemon => (pokemon.id >= 152 && pokemon.id <= 251)));
        }
        if (event.target.value === "III") {
            setPokemonData(pokemonData.filter(pokemon => (pokemon.id >= 252 && pokemon.id <= 386)));
        }
        if (event.target.value === "IV") {
            setPokemonData(pokemonData.filter(pokemon => (pokemon.id >= 387 && pokemon.id <= 493)));
        }
        if (event.target.value === "V") {
            setPokemonData(pokemonData.filter(pokemon => (pokemon.id >= 494 && pokemon.id <= 649)));
        }
        if (event.target.value === "VI") {
            setPokemonData(pokemonData.filter(pokemon => (pokemon.id >= 650 && pokemon.id <= 721)));
        }
        if (event.target.value === "VII") {
            setPokemonData(pokemonData.filter(pokemon => (pokemon.id >= 722 && pokemon.id <= 898)));
        }
    }

    const handleTypeValueChanged = event => {
        setSelectedType(event.target.value);
        if (event.target.value === "n/a") {
            setPokemonData(starterData);
        }
        if (event.target.value === "fire"){
            setPokemonData(pokemonData.filter(pokemon => pokemon.types.map(typeSlot => typeSlot.type.name).includes("fire")));
        }
    }

    return (
        <div className={"filterBar"}>
            <MdOutlineFilterList className={"filterIcon"}/>
            Name:
            <input
                className={"nameSearch"}
                type={"text"}
                placeholder={"Pikachu..."}
                value={filterString}
                onChange={event => handleFilterChange(event)}
            />
            Generation:
            <select value={selectedValue} onChange={event => handleSelectValueChanged(event)}>
                <option>n/a</option>
                <option>I</option>
                <option>II</option>
                <option>III</option>
                <option>IV</option>
                <option>V</option>
                <option>VI</option>
                <option>VII</option>
            </select>
            Type:
            <select value={selectedType} onChange={event => handleTypeValueChanged(event)}>
                <option>n/a</option>
                <option>bug</option>
                <option>dark</option>
                <option>dragon</option>
                <option>electric</option>
                <option>fairy</option>
                <option>fire</option>
                <option>fighting</option>
                <option>flying</option>
                <option>ghost</option>
                <option>grass</option>
                <option>normal</option>
                <option>psychic</option>
                <option>steel</option>
                <option>water</option>
            </select>
            <button className={"resetButton"} onClick={() => handleResetFilter()}>Reset</button>
        </div>
    );
}

export default FilterBar;
